import React from "react";
import "./Blog.css";
import Navbar from "../Navbar/Navbar";
function Blog() {
  return (
    <>
      <div className="main_Nav">
        <Navbar />
      </div>
      <section className="pageheader">
      <div className="banner_vise">
      <h1>#Stay Home</h1>
      <p>save more with coupon & up to 70% off!!</p>
    </div>
      </section>
      <section id='blog'>
      <div className=""></div>
      </section>
    </>
  );
}

export default Blog;
